-5\u0026oh=00_AT-OC68BmHL7eJ2eT2h6Ub9qJLGvLYe53WiAA91rAFMiqQ\u0026oe=62C5D6F9\u0026_nc_sid=4efc9f","config_width":480,"config_height":480},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/290887327_724617575422872_2764298125233645846_n.webp?stp=c180.0.1080.1080a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=Uc8qP3XjSosAX8jKv5c\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_fczC9-S6DFBMpdZw8E14M0u_dRFHoxBjPhET_qeNJ2w\u0026oe=62C5D6F9\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":null}},{"node":{"comments_disabled":false,"__typename":"GraphSidecar","id":"2872432245119224468","edge_media_to_caption":{"edges":[{"node":{"text":"Blink and you\u2019ll miss me but I can finally talk about being @karlurban\u2019s Mom in The Boys!\n\nIt was a crazy experience at the height of lockdowns for COVID19 and I was a bundle of nerves because of it. Karl introduced himself with his beautiful accent so it sounded like \u201cHi I\u2019m Kyle\u2026\u201d and I looked at him confused. I think he thought I didn\u2019t know who he was and so he tried for chit chat between takes and I stumbled through pleasantries - he was absolutely charismatic and kind, saying that the show was a huge success because of people like me. I laughed but he corrected me that it\u2019s true. I asked how Toronto was treating him, he said it was a great place, but the snow and winters he could do without. \n\nI now joke that I have always begged the universe to be on the same show as Jensen Ackles - and the universe listened\u2026 technically! He wasn\u2019t on set when I was there\ud83d\ude2d\n\nBut being on set was a real joy and everyone was delightful, even with COVID being a threat to the production. Being directed and told \u201cyou\u2019re good, I wish I could give you more!\u201d Was a nice ego boost after years of struggling with my actor side.\n\nWatching him play backgammon between takes, not daring to ask for a game, I wish I was less scared of dying from Covid and was a bit more chatty. Karl if you ever read this, you were a real gentleman and so warm and friendly, thank you (I tried really hard not to fangirl on you!) \ud83e\udd13\n\n#theboys #billythebutcher #karlurban #onset #actorslife #acting #butchersmom"}}]},"shortcode":"Cfc7eh7tYqU","edge_media_to_comment":{"count":2},"taken_at_timestamp":1656640628,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/291360191_739001940760461_1042539162532842865_n.jpg?stp=dst-jpg_e35_s1080x1080\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=O-YEfpAr3ZkAX_v616v\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT84-wWmLNEDiMjZg5xjKu6FaVaYB39JEaDNuntrYXRQkQ\u0026oe=62C5CBFA\u0026_nc_sid=4efc9f","edge_liked_by":{"count":9},"edge_media_preview_like":{"count":9},"owner":{"id":"13919698"},"thumbnail_src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/291360191_739001940760461_1042539162532842865_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=O-YEfpAr3ZkAX_v616v\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT-Fb8aUsqbT9jz5Q5RGzsfpfGP0uLJ0UznXxVc3y7A_zg\u0026oe=62C5CBFA\u0026_nc_sid=4efc9f","thumbnail_resources":[{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/291360191_739001940760461_1042539162532842865_n.jpg?stp=dst-jpg_e35_s150x150\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=O-YEfpAr3ZkAX_v616v\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8yyrgITxQxtgEbIiRSplsKTVp78Iclx_jmJ2JY9mGSdw\u0026oe=62C5CBFA\u0026_nc_sid=4efc9f","config_width":150,"config_height":150},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/291360191_739001940760461_1042539162532842865_n.jpg?stp=dst-jpg_e35_s240x240\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=109\u0026_nc_ohc=O-YEfpAr3ZkAX_v616v\u0026edm=ABZ