es.\nNemeses. \n\nWhile enemies in fiction can come and go, the concept of the nemesis is different. \n\nBy definition, the nemesis typically holds some degree of fascination for a protagonist, and often the sentiment is strongly mutual. \nMost of the time, a nemesis is a persistently antagonistic force who\u2019s bent on retribution, will never leave the other character be, and who seems to haunt the mind of the protagonist and because of this obsessive relationship, their personalities can blur and and meld into each other. \n\nFrom what could have begun as mutual straight forward hatred of each other can transmuted into something deeply personal, even intimate.\n\nThere\u2019s *no* doubt Butcher and Homelander want nothing more to kill each other and that is precisely what they agree to do on their own terms despite the eerie geniality of their behaviour. \n\nHowever, what made this exchange particularly excellent is how at this point, they know each other far better than anybody else in their circles ever could.\n\n#theboys #homelander #billybutcher #television"}}]},"shortcode":"Cfc5a8HvFGW","edge_media_to_comment":{"count":0},"taken_at_timestamp":1656639550,"dimensions":{"height":564,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291003577_287376020220983_8027134060042273551_n.jpg?stp=dst-jpg_e35_s1080x1080\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=111\u0026_nc_ohc=E63PwgTFUVkAX_ZzS-u\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_VCgvkd7qvXE_J0kqAYK07VKXHjswWSQGEtvXUbH9PCA\u0026oe=62C62A07\u0026_nc_sid=4efc9f","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"1663666174"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/291003577_287376020220983_8027134060042273551_n.jpg?stp=c343.0.753.753a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=111\u0026_nc_ohc=E63PwgTFUVkAX_ZzS-u\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_