2.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=Wf1tHd14phoAX97M_4C\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_MA2QLT2-JLbbUzi0t9rMvb7C0kVO7I9mMzYeSq09ctw\u0026oe=62C4FF9D\u0026_nc_sid=4efc9f","config_width":320,"config_height":320},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/290703088_364061565752628_6240971379183755183_n.jpg?stp=c0.22.1328.1328a_dst-jpg_e35_s480x480\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=Wf1tHd14phoAX97M_4C\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8CP9S7wCBuEoQ1DSUGxsAdq_o3mBXXVgiNCBBkekxISA\u0026oe=62C4FF9D\u0026_nc_sid=4efc9f","config_width":480,"config_height":480},{"src":"https://instagram.flos1-2.fna.fbcdn.net/v/t51.2885-15/290703088_364061565752628_6240971379183755183_n.jpg?stp=c0.22.1328.1328a_dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-2.fna.fbcdn.net\u0026_nc_cat=100\u0026_nc_ohc=Wf1tHd14phoAX97M_4C\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT_8DxB1Q5mi7Iq_TFtUpMfEa952M4cIbsB79WXfAkGRug\u0026oe=62C4FF9D\u0026_nc_sid=4efc9f","config_width":640,"config_height":640}],"is_video":false,"accessibility_caption":null}},{"node":{"comments_disabled":false,"__typename":"GraphSidecar","id":"2872414320383439526","edge_media_to_caption":{"edges":[{"node":{"text":"Umbrella Academy (S3 - 2022)\n\nUmbrella Academy is a mix of #Watchmen, #AmericanGods and #TheBoys. And like the last two shows, it\u2019s shot in Toronto and Hamilton, Ontario. Maybe it was fitting that I finished the series to kick start the Canada Day long weekend. \ud83c\udde8\ud83c\udde6 \n\nAnyway, to be completely honest, Umbrella Academy was always just \u201cokay\u201d to me. It was a fun and a interesting enough series to follow when I had nothing else to watch. Season 1 was alright and season 2 was confusing and all over the place. But the characters are so diverse, very flawed yet very likeable. Mix that with some time travel, aliens, robot moms, super heroes, f bombs, daddy issues, gravity sex and it becomes a show that\u2019s really hard to ignore and not be curious about. \n\nSeason 3 was surprisingly very enjoyable. The storyline was straight forward and easy to follow compared to the previous season. The old cast was back along with a group of very interesting new characters \u2014 who\u2019s not in love with Sloane? @genirodriguez \ud83d\ude18 And Fei looks like she came straight out of the Matrix, super badass! @bbritneoldfordd \ud83d\ude0e I caught myself laughing out loud several times \u2014 usually it\u2019s a scene with Klaus @rozzymikes or Five @aidanrgallagher. \n\nThe way they execute the story keeps you engaged the entire time. And the little creative details from scene transitions, to the sparrow/umbrella symbols in the openings credits to the random musical sequences are all very well done \u2014 very clever, quirky and witty. Big props to creator and writer, @steveblackmantv. \n\nLike I said, always just thought this show was alright but I really enjoyed this new season and will definitely watch the fourth when it comes out. \n\nTheTVSamurai Score: \u2694\ufe0f\u2694\ufe0f\u2694\ufe0f\u2694\ufe0f\n\nAll 3 seasons of Umbrella Academy are streaming on @netflix @netflixca \n\n#UmbrellaAcademy #Toronto #Ontario #Canada #Netflix #DisneyPlus #Disney #Marvel #MCU #Movie #Movies #Film #Films #Cinema #FilmCommunity #FilmReviews #FilmReviewer #Cinephile #CinephileCommunity #TVReview #TVReviews #MovieReview #MovieReviewer #MovieReviews #MovieRecommendation #TheTVSamurai"}}]},"shortcode":"Cfc3ZsOMzKm","edge_media_to_comment":{"count":3},"taken_at_timestamp":1656638492,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/290789294_1204850190280390_8425529809722182520_n.jpg?stp=dst-jpg_e35\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=110\u0026_nc_ohc=KyfrlUpIF8gAX-I4tsd\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT8HO5Jtn05un8O9AnwyKjTzglmkWnxphrlLablDjqOECg\u0026oe=62C5E371\u0026_nc_sid